    return (
        <div className="d-flex mb-2 justify-content-between">
            <Button type="button" variant="primary" className="btn btn-default btn-circle btn-xl"><FontAwesomeIcon icon="envelope"/></Button>
        </div>
    )
}

export default PizzaCard
